"""# Арифметические операторы в Python

Что у нас собственно по операторам вычислений?
В Питоне они следующие:
* `-` — вычитание
* `*` — умножение
* `**` — возведение в степень (а если возвести в степень 0.5, то можно получить квадратный корень)
* `/` — деление (при делении чисел получается float)
* `//` — целочисленное деление
* `%` — остаток от деления

Однако и тут не так всё легко, как может показаться. Так же, как и в математике, в Питоне есть приоритетность для операторов. Вот наша с вам иерархия приоритетов от высокого к низкому ( для операторов вычесления ):

* Возведение в степень `**`
* Деление `/` Остаток от деления `%` Умножение `*`
* Вычетание `-` Сложение `+`
* Операторы сравнения `in`, `not` `in`, `is`, `is not`, `<`, `<=`, `>`, `>=`, `<>`, `!=`, `==`
"""

