"""**А ШО ЦЕ ТАКЕ!?**

**Ассоциативность** — это порядок, в котором Python выполняет выражения, включающие несколько операторов одного уровня приоритетности. Большая часть из них поддерживают ассоциативность слева направо _(за исключением оператора возведения в степень **)_.

**Неассоциативные операторы**

Наши с вами операторы сравнений не поддерживают ассоциативность. Для них применяются специальные правила порядка, в которых ассоциативность НЕ принимает участия.

Например, выражение `5 < 7 < 9` — это не то же самое, что и `(5 < 7) < 9` или `5 < (7 < 9)`. Зато `5 < 7 < 9` — то же самое, что `5 < 7` и `7 < 9`. Исполняется слева направо.

Так же работает связывание операторов присваивания (например, `a=b=c`), а вот `a = b += c` вернет ошибку.
"""

a = q = 5
a = 1

print(a)
print(id(a))

print(q)
print(id(q))

a = 1

print(a)
