"""# **Работа со встроенными функциями: input, print, type**

Для получения информации с клавиатуры в Python есть функция input() У неё есть опциональный параметр prompt, который является выводимой строкой при вызове функции.

Когда input() вызывается, поток программы останавливается до тех пор, пока пользователь не введет данные через командную строку. Для ввода нужно нажать Enter после завершения набора текста. Обычно Enter добавляет символ новой строки (\n), но не в этом случае. Введенная строка просто будет передана приложению.
"""

input()

input()

input(prompt="type something: ")
input("type something: ")

"""По умолчанию функция input() конвертирует всю получаемую информацию в строку, как можно было убедиться из примеров выше.
В этом плане, если нужно произвести работу с числами, нужно быть немного аккуратным и учитывать эту конвертацию.
Что можно с этим сделать? Преобразовать наш вывод ещё в моменте вызова input():
"""

rq = float(input())

print(type(rq))

"""Как мы уже с вами использовали много раз функцию type(), можно понять, что она помогает нам узнать собственно тип данных какого-то объекта, или же нашей переменной:"""

print(type(85))

print(type(52.7))

print(type("qweqweq"))

print(type([1, 2, 3, 4, 5]))

"""Ну и последнее - наша встроенная функция print().
Благодаря ей мы можем выводить в консоль разного рода значения, которые нам интересны. Так же благодаря этой функции мы можем производить своего роде "дэбаг" нашего кода, когда хотим посмотреть, а что же нам приходит в определённую переменную и т.д.

У этой функции так же есть необязательные аргументы, некоторые из которых работаю по дефолту, вне наших глаз:

* `sep` — это может быть строка, которую необходимо вставлять между значениями, по умолчанию — пробел.
* `end` — это строка, которая добавляется после последнего значения. По умолчанию — это перенос на новую строку (\n). С помощью аргумента end программист может самостоятельно определить окончание выражения print.
"""

print("q", "w", "e", "r", "t", "y")

print("q", "w", "e", "r", "t", "y", sep="")

print("q", "w", "e", "r", "t", "y", sep="+++")

print("q", "w", "e", "r", "t", "y", sep="\n")

print("my", end="------")
print("message")

